    false,nt"url": null,nt"notes": "This metadata describes the digital ortho
    imagery covering Bradford County, FL. This 1"=200' scale imagery is comprised of
    natural color orthophotography with a GSD (Ground Sample Distance) of 1.0 foot.
    Imagery was collected with the Zeiss DMC digital sensor and processed with Intergraph
    DMC image processing software. Imagery is projected in State Plane Coordinate System,
    Florida North using Lambert Conformal map projection parameters. Tiles were cut
    to pre-determined 5000' x 5000' windows as supplied by the Florida DOR.",nt"license_title":
